from itertools import permutations

def count_valid_mappings(n, m, maze, instructions):
    dirs = ((1, 0), (-1, 0), (0, 1), (0, -1))
    per = permutations(dirs)
    start = None
    end = None
    for i in range(n):
        for j in range(m):
            if maze[i][j] == 'S':
                start = (i, j)
            elif maze[i][j] == 'E':
                end = (i, j)
    total = 1
    for p in per:
        (x, y) = start
        for move in instructions:
            (dir_x, dir_y) = p[int(move)]
            x += dir_x
            y += dir_y
            if x < 0 or y < 0 or x >= n or (y >= m) or (maze[x][y] == '#'):
                break
            if maze[x][y] == 'E':
                total += 1
                break
    return total

