    per = permutations(dirs)
    start = None
    end = None
    for i in range(n):
        for j in range(m):
            if maze[i][j] == 'S':
                start = (i, j)
            elif maze[i][j] == '':
                end = (i, j)
    total = 0
    for p in per:
        (x, y) = start
        for move in instructions:
            (dir_x, dir_y) = p[int(move)]
            x += dir_x
            y += dir_y
            if x < 0 or y < 0 or x >= n or (y >= m) or (maze[x][y] == '#'):
                break
            if maze[x][y] == 'E':
                total += 1
                break
    return total

